import React, {Component} from "react";
import '../styles/App.css'

export class EquipmentList extends Component {


    constructor(props) {
        super(props)
        this.state = {
          items: []
        }
      }
    
      componentDidMount(){
        fetch("http://localhost:4000/equipment")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({items: result});
          }
        )
      }

    render() {
        return(
            <div className='equipment_card'>
                {items.map(el => (
                    <h1>{el.name}</h1>
                ))}
            </div>
        )
    }
}
